INSERT INTO tasks (id, title, description, project_title, team_id, status, priority, added_date, solved_date) VALUES
                                                                                                                  (1, 'Alkoholowy zjawisko.', 'Dotyczyć jazda już podział organizacja ramię. Ostatni przykład mierzyć posiadać noc. Maj pochodzenie lecz żyć siebie przeprowadzać.', 'User-centric cohesive open architecture', 21, 'done', 3, '2024-09-25', '2024-11-27'), (2, 'Substancja pani dziewięć (…).', 'Polować często pojechać kultura. Miesiąc styczeń stosować Rumunia. Różnica głupek naukowiec wreszcie.
Brak przeciwko specjalista rzecz pasmo. Fabryka ogień praca że rak.', 'User-centric cohesive open architecture', 9, 'to_do', 3, '2025-03-31', NULL), (3, 'List pustynia znowu niebo.', 'Stanowisko Turcja chcieć potrzebny broń wyrok. Właściwy kierować czterdzieści. Kraj oni strata noga.', 'User-centric cohesive open architecture', 17, 'closed', 4, '2025-05-07', '2025-05-09'), (4, 'Rana zawsze lęk grób.', 'Spadać pić Japonia podstawa ziarno świątynia. Śmiech umiejętność region pięćdziesiąt katolicki spokój. Materiał jesień zrozumieć mrówka.', 'User-centric cohesive open architecture', 4, 'closed', 4, '2024-08-04', '2025-04-26'), (5, 'Bohater kierowca różnica duński.', 'Próba nagły funkcja republika 2 dół masa. Zrobić strumień też produkt sieć.', 'User-centric cohesive open architecture', 6, 'done', 2, '2024-12-11', '2025-04-12'), (6, 'Ubranie alkohol termin.', '40 podróżować cebula wyrażać piwo gniew przedstawiciel angielski. Zacząć pomysł bogaty wygrać kapelusz jedynie.', 'User-centric cohesive open architecture', 19, 'to_do', 2, '2024-09-07', NULL), (7, 'Panować środkowy wzór odcinek nad odnosi', 'Sprzęt zdrowy tamten firma rasa dział spaść. Prezent zdjęcie rozmiar spotkać materiał.
Podróżować warunek broń wisieć dzieło robić. Papier staw policja Niemcy złoto historyczny.', 'User-centric cohesive open architecture', 15, 'to_do', 4, '2024-06-13', NULL), (8, 'M.In. potem kupować rzymski.', 'Ameryka dialekt lubić chociaż liczny. Śnieg pić pojedynczy posługiwać się. Muzyczny służba oddech.', 'User-centric cohesive open architecture', 14, 'done', 5, '2024-09-25', '2025-04-17'), (9, 'Żołnierz uciec dorosły twardy szczęście.', 'Pogląd Warszawa wykonywać uczeń. Uczucie sygnał wielki wiedza służba. Bok otrzymać dzielić ten sam. Sprawiać poprzez miejski pojęcie ozdobny Turcja.', 'User-centric cohesive open architecture', 21, 'backlog', 4, '2025-05-13', NULL), (10, 'Dno czytać urząd wystawa 1000.', 'Wyłącznie zawierać przebywać kościelny. Praca zaczynać Jezus pacjent wieża świadczyć pogoda. Przyrząd zarówno często bydło sąd. Telefon zaraz prawie granica prędkość nieść babcia.', 'User-centric cohesive open architecture', 9, 'closed', 4, '2024-09-16', '2025-06-01'), (11, 'Rak działać drobny.', 'Twój dany twój robotnik we wycieczka pustynia mieć.
Żaden czy np. tani życie herbata obejmować. Zupełnie sądowy kontynent potrafić.', 'Cross-group bi-directional throughput', 23, 'to_do', 3, '2024-11-24', NULL), (12, 'Dom jednocześnie rząd amharski 9 metr.', 'Górski warunek konstrukcja ciepły wczesny koncert Warszawa. Mężczyzna głupek zapalenie poruszać pracować.', 'Cross-group bi-directional throughput', 13, 'backlog', 1, '2024-11-15', NULL), (13, 'Sobą przerwa dać się.', 'Pijany szczęście znaleźć sprzęt więc on. Miasto jeden wspomnienie prosty wybitny odważny szybki. Wyjść cebula wschodni broda liczny chory.', 'Cross-group bi-directional throughput', 5, 'in_progress', 3, '2025-03-25', NULL), (14, 'Zeszły wewnątrz po ważny utwór zima.', 'Ser połowa –. Przestępstwo płyta udać się szwedzki. Grunt sprzedawać obiekt kłaść umowa.
Trzeba małpa teatr broń oddać.', 'Cross-group bi-directional throughput', 11, 'backlog', 3, '2024-09-15', NULL), (15, 'Człowiek las zmęczony.', 'Cesarz biskup powstanie domowy zobaczyć zbudować 90. Postępowanie przeciwnik wakacje wrogi dodatek poznać wierny. Władza wybierać płyta impreza 40.', 'Cross-group bi-directional throughput', 1, 'backlog', 5, '2024-12-28', NULL), (16, 'Przybyć litera mieszkanie strój ucho mec', 'Dodatkowy papież tańczyć powstawać taki wracać grudzień. Siedziba związany zainteresowanie rodzinny zachowanie.
Rok kupić gwiazda uczyć się jej.', 'Cross-group bi-directional throughput', 13, 'done', 2, '2024-10-15', '2025-05-04'), (17, 'Wynik kolejowy Anglia chrześcijański obo', 'Niewielki niż długość dopiero. Korzystać uniwersytet gwałtowny przejść. Zawsze czerwiec planeta dodawać ręka głupota.
Osioł ziemski wytwarzać.', 'Cross-group bi-directional throughput', 4, 'backlog', 1, '2024-10-21', NULL), (18, 'Organizm zakładać dzieło nazwa czerwiec ', 'Transport srebro naród piąty. Złodziej współczesny drapieżny zimno radość który wewnątrz. Działanie trawa pomarańcza okoliczność kontynent żyć. Przyrząd teatr dzień we informacja.', 'Cross-group bi-directional throughput', 14, 'closed', 5, '2024-09-09', '2024-12-16'), (19, 'Grunt stać się zamieszkiwać.', 'Kino linia zakres skała. Kanał medycyna mocno fałszywy międzynarodowy kontynent ukraiński. Ryba trzeci odważny przedstawienie uczyć się. Pacjent jakiś powoli.', 'Cross-group bi-directional throughput', 13, 'closed', 2, '2025-02-01', '2025-03-16'), (20, 'Odcinek funkcja przebywać.', 'Ogólny wesoły odmiana brzuch doświadczenie. Wąż zdolność chory blady otwór. Grunt czerwony wypowiedź wzrok pierś władza.', 'Cross-group bi-directional throughput', 6, 'done', 4, '2025-05-16', '2025-05-26'), (21, 'Drewno kult 10.', 'Brzydki prędkość samochód wybierać.
Zwrot cień długo gniew stawiać znów. Godność butelka nie ma wrażenie.', 'Mandatory user-facing flexibility', 19, 'done', 2, '2025-01-26', '2025-03-11'), (22, 'Swój zamykać.', 'Muzyczny wschód skóra sklep wakacje. Zatoka działanie dobro psychiczny ręka powstawać ciąża zdrowie. Próba francuski studiować.', 'Mandatory user-facing flexibility', 16, 'backlog', 1, '2025-04-28', NULL), (23, 'Środowisko pozostać fakt wykonanie prezy', 'Razem przejść dobry siódmy przebywać. Zachowanie sygnał policja Holandia teatr pisanie. Luty wreszcie gorączka rządzić ssak strach.', 'Mandatory user-facing flexibility', 20, 'backlog', 3, '2024-11-07', NULL), (24, 'Waluta naród podstawowy wiatr ciało Unia', 'Cisza uciec grecki brudny żywy.
Zdrowy klasztor teoria stworzyć nasiono. Brać blady księżyc pytać dziura wnętrze rolnik. Praktyka co talerz seks Austria muzyk port niski.', 'Mandatory user-facing flexibility', 19, 'done', 3, '2024-06-08', '2025-05-20'), (25, 'Publiczny ku zakon cztery złoto wcześnie', '8 pierś wewnątrz herbata. Rolnik kolega wiedzieć kochać dużo Litwa jechać. Dziób Pan restauracja napisać kiedy zabawka.', 'Mandatory user-facing flexibility', 5, 'closed', 4, '2024-08-09', '2025-01-26'), (26, 'Czerwiec kiedy dać.', 'Żart farba rok zakład przyjść. Krowa atak zniszczyć Anglia. Spać ośrodek w postaci średniowieczny głowa określać. Słońce treść odmiana psychiczny o tytuł.', 'Mandatory user-facing flexibility', 23, 'closed', 5, '2024-09-09', '2025-04-21'), (27, 'Dokonywać jabłko dar Żyd dopływ zysk.', 'Maj oczekiwać pieśń. Grudzień ciężki nagle rano rodzina. Biedny mój przyjemny czwarty 60 literatura.
Mama choć korzeń głęboki kolano.', 'Mandatory user-facing flexibility', 19, 'closed', 5, '2025-01-03', '2025-05-31'), (28, 'Wierny nauka widok utwór wypowiedź.', 'Umieć wiedza słowo ślad oczekiwać pieśń. Małpa słuchać wielki przeciwny zdanie majątek.
